import { Nav, Container, Image, Row, Col, Form, NavDropdown, Navbar, Button, NavLink, Card } from "react-bootstrap";
import logo from './img/logo.svg';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faBars, faMagnifyingGlass, faCircleUser } from '@fortawesome/free-solid-svg-icons';

const HeaderApp = () => {
    return (


        <Container fluid>
            <ul>
                <Navbar>
                    <li><Image className="logo_size" src={logo}></Image></li>
                    <li><NavLink to='/'>Home</NavLink></li>
                    <li><NavLink to='/'>Post</NavLink></li>
                    <li><NavDropdown title='Category'>
                        <NavLink to='/'>All</NavLink>
                        <NavLink to='/'>PC</NavLink>
                        <NavLink to='/'>Mobile</NavLink>
                        <NavLink to='/'>Console</NavLink>
                    </NavDropdown></li>
                    <li><FontAwesomeIcon icon={faMagnifyingGlass} className="icon_size" /></li>
                    <li><FontAwesomeIcon icon={faCircleUser} className="icon_size" /></li>
                    <li><FontAwesomeIcon icon={faBars} className="icon_size" /></li>

                </Navbar>
            </ul>
        </Container>
    );
};
export default HeaderApp;
